$btn-background: #e20520;
$text-color: white;
@import url("https://fonts.googleapis.com/css?family=Montserrat|Open+Sans&display=swap");
* {
  margin: 0;
  padding: 0;
  color: white;
  font-family: "Open Sans", sans-serif;
}
a {
  color: $text-color;
  text-decoration: none;
}

body {
  .showcase {
    background: url("https://backgroundcheckall.com/wp-content/uploads/2017/12/netflix-background-9.jpg")
      no-repeat center center/cover;
    height: 93vh;
    position: relative;

    .showcaseTop {
      height: 80px;
      position: relative;
      img {
        height: 45px;
        position: absolute;
        z-index: 1;
        left: 50%;
        top: 50%;
        transform: translate(-50%, -50%);
      }
      a {
        background: $btn-background;
        position: absolute;
        z-index: 1;
        right: 1%;
        top: 50%;
        transform: translate(-50%, -50%);
        padding: 6px 20px;
        border-radius: 5px;
        color: $text-color;
      }
    }
    .showcaseContent {
      position: absolute;
      top: 38%;
      left: 50%;
      z-index: 1;
      transform: translate(-50%, -50%);
      text-align: center;
      h1 {
        font-size: 5rem;
        letter-spacing: 3px;
        padding: 10px 0px;
      }
      p {
        padding: 10px 0px;
        font-size: 2rem;
        margin-bottom: 50px;
      }
      a {
        background: $btn-background;
        letter-spacing: 5px;
        font-size: 1.8rem;
        margin: 100px 0px;
        padding: 25px 60px;
        border-radius: 3px;
      }
    }
  }
  .showcase::after {
    content: "";
    position: absolute;
    top: 0;
    left: 0;
    width: 100%;
    height: 100%;
    z-index: 0;
    background: rgba(0, 0, 0, 0.6);
    box-shadow: inset 100px 50px 200px #000, inset -100px -50px 200px #000;
  }
  //showcase end
  .tabsContainer {
    height: 162px;
    background: #141414;
    border-bottom: 2px solid #3d3d3d;
    .tabs {
      display: grid;
      grid-template-columns: 1fr 1fr 1fr;
      justify-items: center;
      align-items: center;
      height: 100%;
      margin: 0px auto;
      width: 80%;
      text-align: center;
      .tabItem1 {
        border-bottom: 4px solid $btn-background;
        width: 100%;
        height: 100%;
        svg {
          height: 50px;
          padding-top: 40px;
          fill: white;
        }
        p {
          width: 185px;
          margin: 0px auto;
        }
      }
      .tabItem2 {
        // border-bottom: 4px solid $btn-background;
        width: 100%;
        height: 100%;
        svg {
          height: 50px;
          padding-top: 40px;
          fill: gray;
          color: gray;
        }
        p {
          width: 185px;
          margin: 0px auto;
          color: gray;
        }
      }
      .tabItem2:hover {
        p {
          color: white;
        }
      }
      .tabItem3 {
        width: 100%;
        height: 100%;
        svg {
          height: 50px;
          padding-top: 40px;
          fill: gray;
        }
        p {
          width: 185px;
          margin: 0px auto;
          color: gray;
        }
      }
      .tabItem3:hover {
        p {
          color: white;
        }
      }
    }
  }
  .wrap {
    height: 576px;
    background: black;
    .contentContainer {
      height: 100%;
      width: 75%;
      margin: 0px auto;
      .tab1 {
        display: grid;
        grid-template-columns: 50% 40%;
        justify-items: center;
        align-items: center;
        position: relative;
