          img {
            align-self: start;
            width: 100%;
          }
        }
      }
    }
  }
  footer {
    height: 360px;
    background: black;
    .contact {
      width: 75%;
      height: 95%;
      color: #999;
      margin: 0px auto;
      display: grid;
      align-items: center;
      grid-template-columns: 1fr 1fr 1fr 1fr;
      grid-template-rows: 1fr 3fr 1fr 1fr;
      //   grid-template-areas: "questions .", "col1 col2";
